import React from 'react';

const Formation = () => {
    return (
        <div className="formation">
            <div>
                <h2>
                    Bac +2 - Développeur React JS/ Node JS.<br/>A la Wild Code School: de Mai 2020 à deçembre 2020</h2>
                    <p>
                    - L'intégration d'une interface utilisateur : HTML5 et CSS3.<br />
                    - Maîtrise le développement d'une application : Node.JS/Express.JS, JavaScript / React.<br/>
                    - Apprendre à concevoir une base de données, écrire et optimiser les requêtes SQL(MySQL),<br />
                     et utiliser un gestionnaire de versions (GIT)
                    </p>
            </div>
            <div>
                <h2>Formations en ligne : Udemy<br/>JavaScript, avec Louis Nicolas Leuillet(2020)</h2>
            </div>
            <div></div>
            <div></div>
        </div>

    );
};

export default Formation;
